@lappe

Sounds to me like you're trying to install onto the same drive you restored the .dmg to. That's the only reason I can think that it would tell you you can't install to that drive. You'd have to install onto a partition on your internal.

When you run the installer and choose a drive with an existing OS X on it, it'll automatically "update" it, basically installing over it. No need to choose one or the other.

And yeah your Leopard stuff will be fine. I've had zero issues so far and I've been through like 6 installs of various versions of SL.

@everyone talking about this being GM

It's probably not. These rumors start from like one guy on one Mac site speculating about something, and then within minutes, hundreds of other articles spring up stating "A source points to this being the Golden Master" and then "Several sources..." but it's all speculation. Don't believe any of it.. unless the source it points to is Apple.

